import React from 'react';
import { BrowserRouter as Router, Route, Routes } from 'react-router-dom'; // Make sure you import 'Routes'
import Sign from './components/Sign'
import Home from './components/Home';
import Login from './components/Log';
import Tracking from "./components/leaf/leaf"
import Shipping from './components/Shipping';
function App() {


  return (
    <Router>
      <Routes> {/* Use <Routes> for routing */}
        <Route path="/" element={<Home />} />
        <Route path="/login" element={<Login />} /> {/* Define a Route for Login */}
        <Route path="/sign" element={<Sign />} /> 
        <Route path="/shipping" element={<Shipping />} />
        <Route path="/tracking" element={<Tracking />} />
      </Routes>
    </Router>

  );

}

export default App;
